import React, { useEffect } from "react";
import GridRow from "./GridRow";

const Grid = ({ gameState, setGameState }) => {
  const board = gameState.board;
  useEffect(() => {
    console.log(board);
  });

  // 4 by 4 grid
  return (
    <>
      <GridRow
        gridArrayRow={[board[0], board[1], board[2], board[3], board[4]]}
      />
      <GridRow
        gridArrayRow={[board[5], board[6], board[7], board[8], board[9]]}
      />
      <GridRow
        gridArrayRow={[board[10], board[11], board[12], board[13], board[14]]}
      />
    </>
  );
};

export default Grid;
